import * as wasm from './wasm_backend_bg.wasm';

/**
* @returns {number}
*/
export function rows() {
    var ret = wasm.rows();
    return ret >>> 0;
}

/**
* @returns {number}
*/
export function cols() {
    var ret = wasm.cols();
    return ret >>> 0;
}

/**
* @returns {number}
*/
export function wins() {
    var ret = wasm.wins();
    return ret >>> 0;
}

/**
* @param {number} a
* @param {number} b
* @returns {number}
*/
export function add_ints(a, b) {
    var ret = wasm.add_ints(a, b);
    return ret >>> 0;
}
